import {observable, computed, reaction, action} from 'mobx';  

class Users {
    @observable arr: any[] = [ 
            {name: 'Tanya', surname: 'Baikova', age: 18}, 
            {name: 'Pasha', surname: 'Sukhov',  age: 16}
        ];
    deleteUser(name: string): void {
        this.arr = this.arr.filter(el=> el.name!==name)
    }
    addUser(user: any): void {
        this.arr.push(user);
        console.log(this.arr, user)
    };
}
